import React from "react";
import { useRoutes } from "react-router-dom";
import HomeLayout from "../layouts/home";
import Home from "../pages/home/home";

export default function Router() {
  const routing = useRoutes([
    {
      path: "/",
      element: <HomeLayout />,
      children: [
        {
            path: '/',
            element: <Home />
        }
      ]
    },
  ]);
  return routing;
}
